import React,{useState} from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/Dialog';
import DialogActions from '@material-ui/core/DialogActions';
import DialogContent from '@material-ui/core/DialogContent';
import DialogContentText from '@material-ui/core/DialogContentText';
import DialogTitle from '@material-ui/core/DialogTitle';
import ExcelReader from "components/buttons/ExcelReader";
import QuestionListItem from 'components/list/QuestionListItem';

export default function EditQuestions({handleClickOpen,open,handleClose,update}) {
    const [data, setData] = useState([]);

  return (
    <div>
      {/* <Button variant="outlined" color="primary" onClick={handleClickOpen}>
        Open form dialog
      </Button> */}
      <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title" fullWidth maxWidth="lg">
    <DialogTitle id="form-dialog-title">{update? "Update Questions":"Replace Questions"}</DialogTitle>
        <DialogContent style={{scrollbarWidth:"thin"}}>
          <DialogContentText>
            To subscribe to this website, please enter your email address here. We will send updates
            occasionally.
          </DialogContentText>
          <ExcelReader setData={setData} />
          
        {data.map((item, index) => (
          <QuestionListItem
            item={item}
            // onEdit={onEdit}
            // onDelete={onDelete}  
            index={index}
            edit={false}
          />
        ))}
        </DialogContent>
        <DialogActions>
          <Button onClick={()=>{setData([]);handleClose()}} color="primary">
            Cancel
          </Button>
          <Button onClick={()=>{setData([]);handleClose()}} color="primary">
          {update? "Update":"Replace"}
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
